class Solution:
    """
    @param numbers : Given an integers array numbers
    @return : A list of integers whitch sum of them closest to 0 includes the index of the first number and the index of the last number
    """
    def subarraySumClosest(self, nums):
        if nums == None:
            return []

        sum_array = []

        length = len(nums)
        sums = 0
        for i in range(length):
            sums = sums + nums[i]
            sum_array.append((sums, i))

        new_sum_array = sorted(sum_array, key=self.get_sum)

        min_abs = 0x3FFFFFFF

        min_index = [0, 0]
        for i in range(length - 1):
            sum_tupple = new_sum_array[i]
            next_sum_tupple = new_sum_array [i + 1]
            adj_abs = self.my_abs(next_sum_tupple[0] - sum_tupple[0])
            if adj_abs < min_abs:
                min_abs = adj_abs
                min_index = self.get_index(sum_tupple[1], next_sum_tupple[1]) 
                if min_abs == 0:
                    return min_index
        return min_index

    def get_index(self, i, j):
        if i < j:
            return [i + 1, j]
        else:
            return [j + 1, i]

    def get_sum(self, s):
        return s[0]

    def my_abs(self, num):
        if num < 0:
            return -num
        else:
            return num

